import React, { Component } from 'react'

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      todoList: [],
      activeItem: {
        id: null,
        title: '',
        completed: false
      },
      editing : false,
    }
    this.fetchTasks = this.fetchTasks.bind(this)
  }

  componentDidMount() {
    this.fetchTasks()
  }

  fetchTasks(){
    console.log("Fetching")
  }
  render() {
    return (
      <div className="container-fluid bg-primary h-100 ">
        <div className="form-wrapper">
          <form className="p-5" style = {{display: "flex"}}>
            <div class="form-grou w-50">
              <input type="text" class="form-control" placeholder="Enter your task" />              
            </div>            
            <button type="submit" class="btn btn-primary h-75 ml-2">Submit</button>
          </form>
          <div className=""><table class="table">
            <thead>
              <tr>
                <th scope="col">#</th>
                <th scope="col">First</th>
              </tr>
              </thead>
              <tbody>
                <tr>
                  <th scope="row">1</th>
                  <td>Mark</td>
                </tr>
                <tr>
                  <th scope="row">2</th>
                  <td>Jacob</td>
                </tr>                
              </tbody>
            </table>
          </div>
        </div>
      </div>
    )
  }
}
